import React, { useState } from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Nav></Nav>
      const {Kakao} = window;
      const loginWithKakao = () => {
        Kakao.Auth.authorize({
          redirectUri: 'https://developers.kakao.com/tool/demo/oauth'
        })
      }
      <Kakaologin></Kakaologin>
    </div>
  );
}
function Header(props) {
  return (
    <div>
      <h1>주말농장 치유농장 체험농장</h1>
    </div>
  );
}
function Nav(props) {
  return (
    <div>
      <div>소개</div>
      <div>농작물로 치유하기</div>
      <div>레시피</div>
    </div>
  );
}
function Kakaologin(props) {
  const KakaoLogin = () => {
    return (
      <div>
        <a id = "login-btn" onClick = {loginWithKakao}>
          <img src = "kakao_login_medium_narrow.png"/>
        </a>
      </div>
    );;
  }
}

export default App;
